import React from "react";
import MyPosts from "./MyPosts/MyPosts";
import s from './Profile.module.css';

const Profile = ()=>{
    return  <div>
    <div>
    <img className={s.img} src="https://www.rosphoto.com/images/u/articles/1510/3_13.jpg" alt=""></img>
    </div>

    <div>Avatar + desc</div>
    <MyPosts />
  </div>
}

export default Profile;
